commit_message:
Be less strict with dict-style input.

Accept {INDENT_WIDTH=4} or {INDENT_WIDTH : 2}
Raise StyleConfigError if given bad input.

Redefine expr 'triviality' as being a single token.

The previous definition of "exactly matching the loop var" was unsightly
for short expressions such as:

  length = sum(1
               for var_name in gen
               if var_name)

Introduce a SPLIT_BEFORE_ENDING_BRACKET knob

This controls whether closing brackets get a separate line in multiline
literals.

The default is enabled:

    foo = {
        'a': 1
    }

However it can now be disabled:

    foo = {
        'a': 1}
